        function SetAllIdFiltered(element) {
			var idCount = 0;
			$(element).each(function () {
				var id = element + idCount;
				if (id in textcomponent) {
					if (textcomponent[id] in ediagram_link) {
						$(this).css({"fill": selectable_color});
					}
					$(this).attr('id', id);
					$(this).attr('class', "selectable");
				}
				idCount++;
			});
		}

        //Show bord information in bottom left notification (on the mouse hover event)
		function ShowBoardNotifications(board, information) {
			var cont = "";
			event.preventDefault();
			var exinfo = '<p><br><p><p style="word-wrap: break-word;opacity:0.6"><em>' + information + '</em></p>';
			var img = '<img class="notifimg" src="media/electricaldiagram.png" alt=""/>';
			var title = '<h3 style="word-wrap: break-word;padding-left:30px;">' + board + '</h3>';
			if (information == "") {cont = img + title;}
			else {cont = img + title + exinfo;}
			$.notiny({singleton: true, clickhide: false, delay: 10000, position: 'left-bottom', text: cont});
		}

        function ZoomIn() {
			panzoominst.zoomToCenter(1.25);
		}

		function ZoomOut() {
			panzoominst.zoomToCenter(0.75);
		}

		function Reset() {
			panzoominst.AutoCentering();
		}

        var elecoverlay = 1;
        var oldoverlay = "ElecOverlay0";
        function SwitchingDiagram() {
            var imgid = "ElecOverlay" + elecoverlay;
            if (imgid == "ElecOverlay0") {
                $("#ElecOverlay0").animate({"opacity": 1}, 4000);
            }
            else{$("#" + imgid).fadeIn(4000);}
            BuildLegend(elecoverlay);
            if (oldoverlay == "ElecOverlay0") {
                $("#ElecOverlay0").animate({"opacity": 0.25}, 4000);
            }
            else{$("#" + oldoverlay).fadeOut(4000);}
            oldoverlay = imgid;
            elecoverlay++;
            if (elecoverlay > (eld1_legend.length-1)) {
                elecoverlay = 0;
            }

        }

        function AddLegendItem(text, color, extra) {
            $(".list-group").append("<li>" + text + "<span class='badge' style='background-color: " + color + "'>" + extra + "</span></li>").hide().show(300);
        }

        function BuildLegend(id) {
            $(".list-group").empty();
            for (var i = 0; i < eld1_legend[id].length; i++) {
                var title = eld1_legend[id][i][0];
                var color = eld1_legend[id][i][1];
                var extra = eld1_legend[id][i][2];
                AddLegendItem(title, color, extra);
            }
        }

        function PrintDiagram(){
			var imgs = [];
			for (var i = 0; i < eld1_legend.length; i++) {
				var src = $("#ElecOverlay" + i).attr('xlink:href');
				imgs.push(src);}
            printJS({
                printable: imgs,
                type: 'image',
                maxWidth: 'auto',
                header: APLLICATION_COPYRIGHT,
                style: PRINTHEADER});}

        var panzoominst = 0;
        var panzoomtrans = [0, 0, 0];
		function InitElectricalDiagram(){
			//Allow svg zooming and panning
            var surface = document.getElementById('surface1');
            panzoominst = panzoom(surface, {
                minZoom: 0.5,
                maxZoom: 4
            });
            panzoomtrans[0] = panzoominst.getTransform().x;
            panzoomtrans[1] = panzoominst.getTransform().y;
            panzoomtrans[2] = panzoominst.getTransform().scale;
			SetAllIdFiltered("path");
            BuildLegend(0);
			$("#ElecOverlay0").show();
			$(".selectable").on("mouseenter touchstart",function(){
				var id = jQuery(this).attr("id");
				if (textcomponent[id] in ediagram_link){
					$(this).css("cursor", "pointer");
					$(this).css({fill: selected_color, transition: "2s ease-out"});
				}
			}).on("mouseleave touchend",function(){
				var id = jQuery(this).attr("id");
				if (textcomponent[id] in ediagram_link) {
					$(this).css({"fill": selectable_color});
				}
			});
            $(".selectable").on("mouseover touchstart",function(){
                var id = jQuery(this).attr("id");
				ShowBoardNotifications(textcomponent[id], "");
            })
            $(".selectable").on("click touchend",function(){
				var id = jQuery(this).attr("id");
				EDiagramLink(textcomponent[id]);
			})
		}

        $(document).ready(function () {
            if(CheckChromeBrowser()){
